export const ObjetosLiterales = () => {

    const persona = {
        nombre: 'Manuel',
        edad: 37,
        direccion: {
            calle: 'Mallorca',
            numero: 130,
            ciudad: 'Leon',
            estado: 'Guanajuato',
            pais: 'Mexico',
            codigoPostal: 37400
        }
    }


  return (
    <div>
        <h3>Objetos Literales</h3>
        <br />
        <code>
            <pre>
                { JSON.stringify(persona, null, 1) }
            </pre>
        </code>
    </div>
  )
}
